import React, { Component } from 'react';
import toolData from './toolData.json'

class AppData extends Component {
    constructor(props){
        super(props);
        this.state = {
            toolData: toolData
        };
    }

  render() {
    console.log(toolData);
    return (
      <div className="AppData">
        <p>Version: {this.state.version}</p>
      </div>
    );
  }
}

export default AppData;
